create table shippers (
	unique_id VARCHAR(40),
	name VARCHAR(50),
	phone VARCHAR(50),
	email VARCHAR(50),
	password VARCHAR(60),
	photo VARCHAR(50),
	address VARCHAR(50),
	number_of_orders INT,
	number_of_packages INT,
	rating_sum DECIMAL(3,1),
	bio TEXT,
	ccard_info VARCHAR(1000),
	company_information VARCHAR(50),
	driving_record VARCHAR(1000),
	photo_id VARCHAR(1000),
	status VARCHAR(9),
	total_declined INT,
	system_id INT,
	messages TEXT,
	web_link VARCHAR(1000),
	work_schedule VARCHAR(1000),
	time_created DATE,
	time_updated DATE
);
